import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var PlusSquare = createReactComponent("PlusSquare", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}], ["line", {
  x1: "12",
  y1: "8",
  x2: "12",
  y2: "16",
  key: "74zyzz"
}], ["line", {
  x1: "8",
  y1: "12",
  x2: "16",
  y2: "12",
  key: "6hnc9b"
}]]]);
export default PlusSquare;
